        // Function to update charts with animation
        function updateCharts() {
            var pair = document.getElementById('currencyPair').value;
            var chartData = allCharts[pair];
            
            // Apply blur
            document.getElementById('chart1').classList.add('blur');
            document.getElementById('chart2').classList.add('blur');
            
            setTimeout(function() {
                Plotly.react('chart1', JSON.parse(chartData.chart1).data, JSON.parse(chartData.chart1).layout);
                Plotly.react('chart2', JSON.parse(chartData.chart2).data, JSON.parse(chartData.chart2).layout);
                
                // Remove blur
                document.getElementById('chart1').classList.remove('blur');
                document.getElementById('chart2').classList.remove('blur');
            }, 500);  // Wait for blur to complete
        }

        // Initial plot
        document.getElementById('currencyPair').value = "AUDEUR";
        updateCharts();

        // Add event listener
        document.getElementById('currencyPair').addEventListener('change', updateCharts);
    </script>
